import React from "react";
import "./Contact.css";

const Contact = () => {
  return (
      <div className="contact">
    <div className="row ">
      <div className="col">
        <div className="row m-auto">
            <p>Contacts</p>
        </div>
        <div className="row">
            <div className="col">
                <i className="fafa-envelope"></i>
            </div>
        </div>
        <div className="row"></div>
      </div>
    </div>
    </div>
  );
};

export default Contact;
